engine.extend("2.0.0",()=>{window.addEventListener("click",({target:a})=>{let b=a.dataset.cbSetVars;if(b){engine.template.render(b.replace(";","\n")+"\n--")}const c=a.closest("[data-cb-go]");c&&window.go(c.dataset.cbGo)}),engine.template.inserts.add({match:/^set\s+link/i,render(a,b){if(a)return`<passage-link class="link"
					   data-cb-go="${a}"
					   data-cb-set-vars="${b.set}">${b.label}</passage-link>`}})});